import "./footer.css";
import React from "react";

const Footer = () => {
  return (
    <footer id="main-footer">
      <div className="copyright">
        <em>Copyright &copy; 2022 Vanessa Liu</em>
      </div>
    </footer>
  );
};

export default Footer;
